import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';

function App() {
  return (
    <div>
       <h2 style={text-align}>Welcome to React App</h2>
      <Router >
        <Navbar />
        <Route path="/">
          <Home />
        </Route>
      </Router>
    </div>
  );
}

export default App;
